import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';
import { Line } from 'react-chartjs-2';

ChartJS.register(
    CategoryScale,
    LinearScale,
    PointElement,
    LineElement,
    Title,
    Tooltip,
    Legend
  );

class Charts extends Component {

    constructor(props){
        super(props);

        // initiiere einen leeren state
        this.state = {
            options: {
                responsive: true,
                plugins: {
                  legend: {
                    position: 'top',
                  },
                  title: {
                    display: true,
                    text: 'Chart.js Line Chart',
                  },
                },
              },

            labels: ['January', 'February', 'March', 'April', 'May', 'June', 'July'],

            showRunDialog: false,

            loadingInProgress: false,
            error: null
        };
    }


    render(){
          const { runDate, task1Duration, task2Duration, task2WrongTiles, task2AdurationTiletoTile, task3Duration, task3WrongAssignment } = this.state;
          return (
            <Line options={this.state.options} data={this.state.data} />
          );
        }
}

export default Charts;
